/* eslint-disable react/prop-types */
/* eslint-disable no-console */

import React from 'react';

import { BrowserRouter as Router, Route } from 'react-router-dom';

// pages
import Event from '../../pages/event';
import Events from '../../pages/events';
import Home from '../../pages/home';
import Join from '../../pages/join';
import Login from '../../pages/login';
import Post from '../../pages/post';
import PostAdmin from '../../pages/postAdmin';
import PostForm from '../../pages/postForm';
// pages
import Profile from '../../pages/profile';
import Settings from '../../pages/settings';
import Users from '../../pages/users';
// components
import Footer from '../footer';
import Header from '../header';
import MochDatabase from '../mochDatabase';
import SideMenu from '../sideMenu';

const mochDatabase = ({ users }) => {
  function filterDates(date) {
    const newDate = date.substr(0, 10);
    newDate.replace(/-/g, '/');
    return newDate;
  }

  function convertUsers(arr) {
    arr.map((user) => {
      const userData = [
        {
          cell: user.cell,
          dob: {
            age: user.dob.age,
            date: filterDates(user.dob.date),
          },
          email: user.email,
          gender: user.gender,
          id: {
            name: user.id.name,
            value: user.id.value,
          },
          location: {
            city: user.location.city,
            coordinates: {
              latitude: user.location.coordinates.latitude,
              longitude: user.location.coordinates.longitude,
            },
            country: user.location.country,
            postcode: user.location.postcode,
            state: user.location.state,
            street: {
              name: user.location.street.name,
              number: user.location.street.number,
            },
            timezone: {
              description: user.location.timezone.description,
              offset: user.location.timezone.offset,
            },
          },
          login: {
            md5: user.login.md5,
            password: user.login.password,
            salt: user.login.salt,
            sha1: user.login.sha1,
            sha256: user.login.sha256,
            username: user.login.username,
            uuid: user.login.uuid,
          },
          name: {
            first: user.name.first,
            last: user.name.last,
            title: user.name.title,
          },
          nat: user.nat,
          phone: user.phone,
          picture: {
            large: user.picture.large,
            medium: user.picture.medium,
            thumbnail: user.picture.thumbnail,
          },
          registered: {
            age: user.registered.age,
            date: filterDates(user.registered.date),
          },
        },
      ];
      return userData;
    });
  }
  const { usersData } = convertUsers(users);
  return (
    <>
      <Router>
        <Header />
        <SideMenu />
            <main className={styles.content}>
              <Route exact path="/home">
                <Home users={users} />
              </Route>
              <Route exact path="/create-post" component={PostForm} />
              <Route exact path="/settings">
                <Settings users={users} />
              </Route>
              <Route exact path="/">
                <Login users={users} />
              </Route>
              <Route exact path="/join" component={Join} />
              <Route exact path="/posts/edit/:postId" component={PostForm} />
              <Route exact path="/posts/:postId" component={Post} />
              <Route exact path="/posts" component={PostAdmin} />
              <Route exact path="/users/profile/:uuid">
                <Profile users={users} />
              </Route>
              <Route exact path="/users">
                <Users users={users} />
              </Route>
              <Route exact path="/events" component={Events} />
              <Route exact path="/events/:eventId" component={Event} />
            </main>
            <Footer />
          </Router>
      </>
  )
};

export default mochDatabase;
